import { megapack } from "../../constants";
import { En_Hero } from "../Portal";

const Megapack = () => {
  return (
    <>
      <En_Hero
        prod={megapack}
        title="Megapack"
        subtitle="Massive Energy Storage"
        get={megapack.getLink}
        dark
      />
    </>
  );
};

export default Megapack;
